import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Home from "./components/Home";
import After from "./components/After";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/after" element={<After />} />
    </Routes>
  );
}

export default App;
